import React from 'react';
import { Menu, Row, Col } from 'antd';            // https://ant.design/components/menu/
import styled from 'styled-components';


const DDiv = styled.div`
    width: 100%;
    background: #FA5A5A;  /* fallback for old browsers */
    background: -webkit-linear-gradient(to right, #f80759, #FA5A5A);  /* Chrome 10-25, Safari 5.1-6 */
    background: linear-gradient(to right, #f80759, #FA5A5A); /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */
`;


const MenuBar = () => {
    return (
        <DDiv style={{color: 'white', position: 'fixed', height: '75px', width: '100%', right: 0, top: 0, left: 0}}>
            <nav style={{float: "right", marginTop: 20}}>
                <span style={{marginRight: '10vh'}}><a href="#home">HOME</a></span>
                <span style={{marginRight: '10vh'}}><a href="#about">ABOUT</a></span>
                <span style={{marginRight: '10vh'}}><a href="#charactor">CHARACTOR</a></span>
                <span style={{marginRight: '10vh'}}><a href="#help">HELP</a></span>
            </nav>
        </DDiv>
    );
};

export default MenuBar;
